import React, { Component } from 'react';
import './style.css';

import { useState } from 'react'
function Login() {
    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const handleOnSubmit = () => {
      // Where we're fetching data from
      return fetch("http://localhost:8080/api/auth/signin")
      // We get the API response and receive data in JSON format
        .then((response) => response.json())
        .then((data) => console.log(data))
        .catch ((error) => console.error(error));
        alert("dawdawd");
  }


        return (
            <div>
                   
<div className="card">
   <article className="card-body">
      <a href="/register" className="float-right btn btn-outline-primary">Sign up</a>
      <h4 className="card-title mb-4 mt-1">Sign in</h4>
      <form>
         <div className="form-group">
            <label>Your email</label>
            <input  className="form-control" placeholder="Email" type="email" value={name} onChange={(e) => setName(e.target.value)}/>
         </div>
  
         <div className="form-group">
            <a className="float-right" href="#">Forgot?</a>
            <label>Your password</label>
            <input className="form-control" placeholder="******" type="password" value={email} onChange={(e) => setEmail(e.target.value)}/>
         </div>
       
         <div className="form-group">
            <div className="checkbox">
               <label> <input type="checkbox"/> Save password </label>
            </div>
            
         </div>
       
         <div className="form-group">
            <button type="submit" className="btn btn-primary btn-block" onClick={handleOnSubmit}> Login  </button>
         </div>
                                                       
      </form>
   </article>
</div>
            </div>
        );
    }


export default Login;
